import React from 'react';
import { connect } from 'react-redux';
import ClientsList from './DataTablesComponents/Clients';
import MaterialsList from './DataTablesComponents/Materials';
import ServicesList from './DataTablesComponents/Services';
import OrdersList from './DataTablesComponents/Orders';
import SchedulesList from './DataTablesComponents/Schedules';
import ProfilesList from './DataTablesComponents/Profiles';
import PromosList from './DataTablesComponents/Promos';
import FeedbacksList from './DataTablesComponents/Feedbacks';
import EmployeesList from './DataTablesComponents/Employees';

class StaffMainMenu extends React.PureComponent {
  render() {
    var activeOption;
    switch (this.props.activeMenu) {
      case 'clientsPage':
        activeOption = <ClientsList />;
        break;

      case 'materialsPage':
        activeOption = <MaterialsList />;
        break;

      case 'servicesPage':
        activeOption = <ServicesList />;
        break;

      case 'ordersPage':
        activeOption = <OrdersList />;
        break;

      case 'schedulesPage':
        activeOption = <SchedulesList />;
        break;

      case 'profilesPage':
        activeOption = <ProfilesList />;
        break;

      case 'promoPage':
        activeOption = <PromosList />;
        break;

      case 'feedbacksPage':
        activeOption = <FeedbacksList />;
        break;

      case 'stuffPage':
        activeOption = <EmployeesList />;
        break;

      default:
        break;
    }
    return (
      <>
        <div className="mainarea">{activeOption}</div>
      </>
    );
  }
}

function mapStateToProps(state) {
  return {
    activeMenu: state.activeMenu,
    checkStateForRender: state.checkStateForRender,
  };
}

function mapDispatchToProps(dispatch) {
  return {};
}

export default connect(mapStateToProps, mapDispatchToProps)(StaffMainMenu);
